        valueI3: dataConsultFatca['indicators'][2]['value'],
        indicatorIdI4: dataConsultFatca['indicators'][3]['indicatorId'],
        nameI4: dataConsultFatca['indicators'][3]['name'],
        valueI4: dataConsultFatca['indicators'][3]['value'],
